import NavBar from "./components/NavBar/NavBar";
import SimpleDesign from "./components/SimpleDesign/SimpleDesign";
import Home from "./components/HomePage/Home";
import MeetUs from "./components/MeetUs/MeetUs";
import AboutUs from "./components/AboutUsPage/AboutUs";
import Blog from "./components/BlogPage/Blog";
import Contact from "./components/ContactPage/Contact";
import Footer from "./components/Footer/Footer";
import {BrowserRouter as Router, Switch, Route} from 'react-router-dom';
import Icon from './components/Icons/Icon';
import Info from "./components/Icons/Info";


function App() {
  return (
    <Router>
        <NavBar>
        <Switch>
        <Route exact path="/info"  component={Info}></Route>
        <Route exact path="/gallery" exact component={Gallery}></Route>
        <Route exact path="/port" exact component={Portofolio}></Route>
        <Route exact path="/fqa" exact component={FAQ}></Route>
    </Switch>
        </NavBar>
        <Home/>
        <Icon/>
        <AboutUs />
        <SimpleDesign/>
        <Blog />
        <MeetUs />
        <Contact />
        <Footer />
    </Router>
  );
}

export default App;
